import Tab from 'react-bootstrap/Tab';
import Tabs from 'react-bootstrap/Tabs';
import Cards from '../Card/Cards';

function ItemsTab(props) {
  return (
    <Tabs style={{marginLeft: '10px', marginRight:'10px'}}
      variant='pills'
      defaultActiveKey="pizzas"
      id="justify-tab-example"
      className="mb-3"
      justify={true}
    >
      <Tab eventKey="pizzas" title="Pizza's">
        <Cards menu={props.menu} />
      </Tab>
      <Tab eventKey="chinese" title="Chinese">
        <Cards menu={props.menu} />
      </Tab>
      <Tab eventKey="south" title="south">
        <Cards menu={props.menu} />
      </Tab>
      <Tab eventKey="northernTadka" title="Northern Tadka">
        <Cards menu={props.menu} />
      </Tab>
    </Tabs>
  );
}

export default ItemsTab;
